import React from 'react';
import { Form, Input, Button, List, Card } from 'antd';
import { StopOutlined } from '@ant-design/icons';

const Profile = () => {
    return (
        <div>
          <Form style={{marginBottom: '20px', border:'1px solid #d0d0d0', padding: '20px'}}>
            <Input addonBefore="닉네임" />
            <Button type="primary">수정</Button>
          </Form>
          <List
           style={{marginBottom:'20px'}}
           gird={{gutter: 4, xs:2, md:3}}
           size="small"
           header={<div>팔로워 목록</div>}
           loadMore={<Button style={{width:'100%'}}>더보기</Button>}
           bordered
           dataSource={['정선재','입니다.']}
           renderItem={item=>(
             <List.Item style={{marginTop: '20px'}}>
               <Card actions={[<StopOutlined/>]}>
                 <Card.Meta description={item} />
               </Card>
             </List.Item>
           )}
           />
              <List
           style={{marginBottom:'20px'}}
           gird={{gutter: 4, xs:2, md:3}}
           size="small"
           header={<div>팔로윙 목록</div>}
           loadMore={<Button style={{width:'100%'}}>더보기</Button>}
           bordered
           dataSource={['정선재','입니다.']}
           renderItem={item=>(
             <List.Item style={{marginTop: '20px'}}>
               <Card actions={[<StopOutlined/>]}>
                 <Card.Meta description={item} />
               </Card>
             </List.Item>
           )}
           />
        </div>
    )
};

export default Profile;
